import React, { Component } from "react";
import Particles from 'react-tsparticles';
import { render } from 'react-dom';

class particlesettings extends Component {
    render() {
        return (
            < div >
                <Particles
                    height='1000px' width='100vw'
                    id='tsparticles'
                    optiond={{
                        background: {
                            color: {
                                value: '#0d47a1'
                            },
                        },
                        fpslimit: 60,
                    }} />
            </div >
        )
    }
}

export default particlesettings;
